description:
PLOT: 
A brilliant doctor on a quest for revenge buys a young woman and trains her to be the ultimate assassin, implanting gun parts in her body that she must later assemble and use to kill her target before she bleeds to death.

ACTORS: 
Asami, Kairi Narita, Noriaki Kamata, Matthew Floyd Miller, Dean Simone, Toshiya Agata, Marco Ballare, Marianne Bourg, Stacey Chu, D. Olivia Jordan, Nina Kate, Lauren Lakis, Mark Laurnoff, Jennifer Mullaney, Tatsuya Nakadai, Derick Neikirk, Midori M. Okada, Mika Santoh, Racquel Service, Andrew Shepherd, Bill Weatherford, 

